import React from 'react'
import {View,Text} from 'react-native'



const ReviewDetails = ({navigation})=>{
    return(
        <>
        <View>
            <Text>{navigation.getParam("title")}</Text>
        </View>
       
        </>
    )
}
export default ReviewDetails
